(130, 148, 'Positions', 'positions', '<p>This Joomla! template supports a wide variety of module positions which can be archived automatically by the system.The module positions are fully collapsible mean that if there are no modules published in particular position, this module position will disappear and the other modules with take this place. Also you can have 2-Columns layout (content, left or right)</p>\r\n<div class="pages-position"><button class="btn btn-lg" type="button" data-toggle="modal" data-target="#myModal"> Position Layout1 </button> <!-- Modal -->\r\n<div id="myModal" class="modal fade bs-example-modal-lg" tabindex="-1">\r\n<div class="modal-dialog">\r\n<div class="modal-content">\r\n<div class="modal-header"><button class="close" type="button" data-dismiss="modal">×</button>\r\n<h4 class="modal-title">Position Layout 1</h4>\r\n</div>\r\n<div class="modal-body"><img src="images/position1.jpg" alt="position1" /></div>\r\n</div>\r\n</div>\r\n</div>\r\n</div>', '', 1, 9, '2015-07-24 03:32:00', 164, '', '2016-01-27 04:57:00', 164, 0, '0000-00-00 00:00:00', '2015-07-24 03:32:00', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":"","link_category":"","show_parent_category":"","link_parent_category":"","show_author":"","link_author":"","show_create_date":"","show_modify_date":"","show_publish_date":"","show_item_navigation":"","show_icons":"","show_print_icon":"","show_email_icon":"","show_vote":"","show_hits":"","show_noauth":"","urls_position":"","alternative_readmore":"","article_layout":"","show_publishing_options":"","show_article_options":"","show_urls_images_backend":"","sho