ub" icon="" ] [yt_pricing_tables type="style3" columns="3" ] [yt_pricing_tables_item title="JEC Personal" icon_name="icon: angle-double-right" button_link="JEC Personal" button_label="Join Now" price="$49" per="no" featured="no" text="Classic Plan" background="red" color="#fff" ]\r\n<ul class="pricing-list">\r\n<li><strong>1 </strong> Domains Limit <a class="boxtip" href="#" rel="tooltip" data-original-title="Number of domains supported: you are entitled to install our products. The membership you purchase specifies the total number of domains supported.">(?) </a></li>\r\n<li><strong>Access to All Templates <a class="boxtip" href="#" rel="tooltip" data-original-title="You can download and use any available templates.">(?) </a> </strong></li>\r\n<li><strong>Access to All Extensions <strong><a class="boxtip" href="#" rel="tooltip" data-original-title="You can download extensions included in templates only. All Extensions of SmartAddons can be downloaded with Developer Membership">(?) </a></strong> </strong></li>\r\n<li>No Discount <a class="boxtip" href="#" rel="tooltip" data-original-title="In case you require to renew your membership after it has expired you can benefit from the discount options that we offer.">(?) </a></li>\r\n<li>Support Forum / Ticket</li>\r\n</ul>\r\n[/yt_pricing_tables_item] [yt_pricing_tables_item title="JEC Business" icon_name="icon: angle-double-right" button_link="http://www.smartaddons.com/index.php?option=com_osemsc&amp;view=register&amp;Itemid=292&amp;step=step2&amp;layout=twocolumns&amp;msc_id=2" button_label="Join Now" price="$79" per="no" featured="no" text="Best choise" background="red" color="#fff" ]\r\n<ul class="pricing-list">\r\n<li><strong>5 </strong> Domains Limit <a class="boxtip" href="#" rel="tooltip" data-original-title="Number of domains supported: you are entitled to install our products. The membership you purchase specifies the total number of domains supported.">(?) </a></li>\r\n<li><strong>Access to All Templates <a class="boxtip" href="#" rel="tooltip" data-original-title="You can download and use any available templates.">(?) </a> </strong></li>\r\n<li><strong>Access to All Extensions <strong><a class="boxtip" href="#" rel="tooltip" data-original-title="You can download extensions included in templates only. All Extensions of SmartAddons can be downloaded with Developer Membership">(?) </a></strong> </strong></li>\r\n<li>No Discount 10% <a class="boxtip" href="#" rel="tooltip" data-original-title="In case you require to renew your membership after it has expired you can benefit from the discount options that we offer.">(?) </a></li>\r\n<li>Support Forum / Ticket</li>\r\n</ul>\r\n[/yt_pricing_tables_item] [yt_pricing_tables_item title="JEC Developer" icon_name="icon: angle-double-right" button_link="http://www.smartaddons.com/index.php?option=com_osemsc&amp;view=register&amp;Itemid=292&amp;step=step2&amp;layout=twocolumns&amp;msc_id=3" button_label="Join Now" price="$99" per="no" featured="yes" text="unlimated features" background="red" color="#fff" ]\r\n<ul class="pricing-list">\r\n<li>Domains Unlimited <a class="boxtip" href="#" rel="tooltip" data-original-title="Number of domains supported: you are entitled to install our products. The membership you purchase specifies the total number of domains supported.">(?) </a></li>\r\n<li><strong>Access to All Templates <a class="boxtip" href="#" rel="tooltip" data-original-title="You can download and use any available templates.">(?) </a> </strong></li>\r\n<li><strong>Access to All Extensions <strong><a class="boxtip" href="#" rel="tooltip" data-original-title="You can download extensions included in templates only. All Extensions of SmartAddons can be downloaded with Developer Membership">(?) </a></strong> </strong></li>\r\n<li>No Discount 30% <a class="boxtip" href="#" rel="tooltip" data-original-title="In case you require to renew your membership after it has expired you can benefit from the discount options that we offer.">(?) </a></li>\r\n<li>Support Forum / Ticket</li>\r\n</ul>\r\n[/yt_pricing_tables_item] [/yt_pricing_tables] [/yt_tabs_item] [/yt_tabs]\r\n<p>[yt_spacer height="20" ]</p>\r\n<h2 class="fontsize_l">Frequently Asked Questions</h2>\r\n<p>Frequently asked questions for our Joomla! Templates Club memberships.</p>\r\n[yt_accordion align="left" width="100" style="border" color_active="#4e9e41"] [yt_accordion_item title="What will I get after I join a membership plan?" icon="icon: plus" icon_color="#000" icon_size="14" color_title="#777" color_desc="#777" active="yes" background="#fff" border_color="#e1e1e1" ]\r\n<ul style="list-style: none;">\r\n<li><strong>1. Template Membership</strong>: After you join the club, you will immediately access the download area of the templates. There you should find your favorite template and download it. You will see two parts for each download: The Source Files and The All In One Package. The All In One Package contains all the files that are necessary to install the template on the site: the Template file, the Cloner Installer to make your site exactly like the demo, all the modules, components and plug-ins included in that template and of course the documentation guide. The Source Files package contains the Adobe Photoshop files so that you can easily edit the design part of the template.</li>\r\n<li><strong>2. Extension Membership</strong>: After you join the club, you will immediately access the download area of the extensions. There you should find your favorite extension and download it.</li>\r\n</ul>\r\n<p>[/yt_accordion_item] [yt_accordion_item title="What payment methods do you accept?" icon="icon: plus" icon_color="#777" icon_size="14" color_title="#777" color_desc="#777" active="no" background="#fff" border_color="#e1e1e1" ]</p>\r\n<p>We accept PayPal payments, credit cards (major credit cards like Visa, MasterCard, Maestro, American express etc.). The payments are managed by 2CheckOut, one of the most powerful payment gateway systems. They are completely secure as you are the only one who has access to your financial information. You may also pay through bank transfer. Please, contact us for further details regarding the payment methods.</p>\r\n<p>[/yt_accordion_item] [yt_accordion_item title="What will happen after my membership expires?" icon="icon: plus" icon_color="#777" icon_size="14" color_title="#777" color_desc="#777" active="no" background="#fff" border_color="#e1e1e1" ]</p>\r\n<p>After your membership expires you may continue using the same template/extension you have downloaded and installed on your domain. In fact, you may use the same template/extension for lifetime if you wish. No other payment is required to keep the same template/extension. The payment is a one-time fee. However, you won''t be able to have support from SmartAddons after the expiry. Support is given as long as you are an active member.</p>\r\n<p>[/yt_accordion_item] [yt_accordion_item title="Membership fees are refundable?" icon="icon: plus" icon_color="#777" icon_size="14" color_title="#777" color_desc="#777" active="no" background="#fff" border_color="#e1e1e1" ]</p>\r\n<p>Yes, we have a money back program that refunds completely your payment, if it is asked for it up to 7 days after your subscription day. Although it is a money back program, we will need a valid reason to refund your payment. We can''t accept motives like "I didn''t notice this product was for Joomla" or "I didn''t realize this template doesn''t work with Joomla 1.5". Of course, we take our responsibility for any possible problem with our products and will refund your money if we haven''t delivered you the promised product.</p>\r\n<p>[/yt_accordion_item] [yt_accordion_item title="How many templates/extensions am I allowed to download/use? " icon="icon: plus" icon_color="#777" icon_size="14" color_title="#777" color_desc="#777" active="no" background="#fff" border_color="#e1e1e1" ]</p>\r\n<p>The number of the templates/extensions that you may use depends on the membership plan that you have joined. You are free to download as many templates/extensions as you consider appropriate in order to test and check them out, regardless the plan that you chose. However, you may not take advantage of every template/extensions that you have downloaded. The membership plan limits you to a specific number of domains in which you can install the templates/extensions. For Personal Membership this is two, meaning that you can use two domains. For Business Membership and Developer Membership the number is Unlimited, meaning that there is no limit in the number of domains to be created.</p>\r\n<p>[/yt_accordion_item] [yt_accordion_item title="Can I use the templates/extensions for non commercial and nonprofit sites? " icon="icon: plus" icon_color="#777" icon_size="14" color_title="#777" color_desc="#777" active="no" background="#fff" border_color="#e1e1e1" ]</p>\r\n<p>You may use the templates/extensions for commercial and non commercial purpose. You may use it to create your company''s or personal website. If you are a designer or a freelancer, you can use them for your clients. Our templates/extensions have been also used from non profits organizations and institutions, as well as churches. However, you may not use our templates/extensions to create sites which convey to inappropriate content like crime, violence, threatening etc.</p>\r\n[/yt_accordion_item] [/yt_accordion]</div>', '', 1, 91, '2013-02-25 08:30:29', 164, '', '2016-01-22 09:28:25', 164, 0, '0000-00-00 00:00:00', '2013-02-25 08:30:29', '0000-00-00 00:00:00', '{"image_intro":"","float_intro":"","image_intro_alt":"","image_intro_caption":"","image_fulltext":"","float_fulltext":"","image_fulltext_alt":"","image_fulltext_caption":""}', '{"urla":false,"urlatext":"","targeta":"","urlb":false,"urlbtext":"","targetb":"","urlc":false,"urlctext":"","targetc":""}', '{"show_title":"","link_titles":"","show_tags":"","show_intro":"","info_block_position":"","show_category":