(16, 380, 0, 'John Levis', '2015-10-19 07:04:11', 'Nothing is lost; the infantile wishes and primitive impulses can always be demonstrated in the grown-up and on occasion can be brought back to the surface. In his dreams the normal person is constantly reviving his childhood, and the neurotic or psychotic individual merges back into a sort of psychic infantilism through his morbid productions.', 'JohnLevis@gmail.com', '', 1),
