(162, 'COM_FINDER_ADVANCED_TIPS', '<p>هنا بعض الأمثلة على كيفية استخدام ميزة البحث:</p><p>ادخال <span class="term">هذا و ذلك</span> في النموذج سوف تحصل على نتائج البحث التي تحتوي على حد سواء "هذا" و "ذلك".</p><p>ادخال <span class="term">هذا و ليس ذلك</span> في النموذج سوف تحصل على نتائج البحث التي تحتوي على "هذا" وليس "ذلك".</p><p>ادخال <span class="term">هذا أو ذلك</span> في النموذج سوف تحصل على نتائج البحث التي تحتوي إما "هذا" أو "ذلك".</p><p>ادخال <span class="term">"هذا و ذلك"</span> (في وسط علامات الاقتباس) في النموذج سوف تحصل على نتائج البحث التي تحتوي على العبارة بالتحديد "هذا و ذلك".</p><p>ويمكن أيضا أن تكون نتائج البحث مفلترة باستخدام مجموعة متنوعة من المعايير. اختيار واحد أو أكثر من الفلاتر أدناه لتبدأ.</p>', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_finder.ini'),
