(330, 'COM_USERS_EMAIL_ACCOUNT_DETAILS', 'تفاصيل حساب %s في %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(331, 'COM_USERS_EMAIL_ACTIVATE_WITH_ADMIN_ACTIVATION_BODY', 'مرحباً مدير الموقع،\\n\\nلقد قام مستخدم جديد بالتسجيل في %s.\\nوقد قام المستخدم بتأكيد عنوان بريده الإلكتروني, ويطلب منك المصادقة على حسابه.\\nوهذه الرسالة تتضمن تفاصيل حسابهs:\\n\\n  الاسم:  %s \\n  البريد الإلكتروني:  %s \\n اسم المستخدم:  %s \\n\\nيمكنك تفعيل حساب المستخدم بالضغط على الرابط أدناه:\\n %s \\n', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(332, 'COM_USERS_EMAIL_ACTIVATE_WITH_ADMIN_ACTIVATION_SUBJECT', 'مطلوب الموافقة على تسجيل حساب %s في %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(333, 'COM_USERS_EMAIL_ACTIVATED_BY_ADMIN_ACTIVATION_BODY', 'مرحباً %s،\\n\\nلقد تم تفعيل حسابك من قبل مدير الموقع. يمكنك الآن تسجيل الدخول إلى موقع %s باستخدام اسم المستخدم التالي: %s وكلمة المرور التي قمت بإدخالها أثناء عملية التسجيل.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(334, 'COM_USERS_EMAIL_ACTIVATED_BY_ADMIN_ACTIVATION_SUBJECT', 'تم تفعيل حساب %s في %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(335, 'COM_USERS_EMAIL_PASSWORD_RESET_BODY', 'مرحباً،\\n\\nلقد تم إنشاء طلب إعادة تعيين %s كلمة المرور. لإعادة تعيين كلمة المرور, يجب عليك القيام بإرسال كود التحقق هذا لكي يتم التأكد من شرعية هذا الطلب.\\n\\nكود التحقق هو %s\\n\\nقم بالضغط على رابط الإنترنت أدناه لكي تقوم بإدخال كود التحقق ومتابعة تعيين كلمة مرور جديدة.\\n\\n %s \\n\\nوشكراً.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(336, 'COM_USERS_EMAIL_PASSWORD_RESET_SUBJECT', 'طلبك %s الخاص بإعادة تعيين كلمة المرور لحسابك', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(337, 'COM_USERS_EMAIL_REGISTERED_BODY', 'مرحباً %s،\\n\\nشكراً لك على التسجيل في موقع %s.\\n\\n يمكنك الآن تسجيل الدخول إلى %s باستخدام اسم المستخدم وكلمة المرور اللذين سجلت بهما.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(338, 'COM_USERS_EMAIL_REGISTERED_BODY_NOPW', 'مرحباً %s,\\n\\nشكراً لتسجيلك في موقع %s.\\n\\nيمكنك الآن تسجيل الدخول إلى %s باستخدام اسم المستخدم وكلمة المرور اللذين سجلت بهما.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(339, 'COM_USERS_EMAIL_REGISTERED_NOTIFICATION_TO_ADMIN_BODY', 'مرحبا بمدير الموقع, \\n\\n مستخدم جديد ''%s'', اسم المستخدم ''%s'', قام بالتسجيل في %s.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(340, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY', 'مرحباً %s،\\n\\nشكراً لك على التسجيل في موقع %s. لقد تم إنشاء حسابك ويجب تفعيله قبل أن تتمكن من استخدامه.\\n لتفعيل الحساب قم بالنقر على الرابط التالي أو قم بنسخه ولصقه في نافذة متصفح جديدة:\\n%s \\n\\n بعد التفعيل يمكنك تسجيل الدخول إلى %s باستخدام اسم المستخدم وكلمة المرور التاليين:\\n\\n اسم المستخدم: %s\\nكلمة المرور: %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(341, 'COM_USERS_EMAIL_REGISTERED_WITH_ACTIVATION_BODY_NOPW', 'مرحباً %s,\\n\\nشكراً لك على التسجيل في موقع %s. لقد تم إنشاء حسابك ويجب تفعيله قبل أن تتمكن من استخدامه.\\nلتفعيل الحساب قم بالنقر على الرابط التالي أو قم بنسخه ولصقه في نافذة متصفح جديدة:\\n%s \\n\\nبعد التفعيل يمكنك تسجيل الدخول إلى %s باستخدام اسم المستخدم و كلمة المرور المستخدمة عند التسجيل:\\n\\nاسم المستخدم: %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(342, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY', 'مرحباً %s،\\n\\nشكراً لتسجيلك في موقع %s. لقد تم إنشاء حسابك، ولكن بحاجة إلى التحقق منه قبل تمكنك من استخدامه.\\nمن أجل تأكيد الحساب، قم بالضغط على الرابط أدناه، أو قم بنسخه ولصقه في نافذة متصفح جديدة:\\n %s \\n\\nبعد قيامك بتأكيد الحساب سيتم إعلام مدير الموقع ليقوم بتفعيل حسابك. سوف يتم إعلامك عند المصادقة على الحساب.\\nحالما يتم تفعيل الحساب يمكنك تسجيل الدخول إلى موقع %s باستخدام اسم المستخدم وكلمة المرور التاليين:\\n\\nاسم المستخدم: %s\\nكلمة المرور: %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(343, 'COM_USERS_EMAIL_REGISTERED_WITH_ADMIN_ACTIVATION_BODY_NOPW', 'مرحباً %s,\\n\\nشكراً لتسجيلك في موقع %s. لقد تم إنشاء حسابك، ولكن بحاجة إلى التحقق منه قبل تمكنك من استخدامه.\\nمن أجل تأكيد الحساب، قم بالضغط على الرابط أدناه، أو قم بنسخه ولصقه في نافذة متصفح جديدة:\\n %s \\n\\nبعد قيامك بتأكيد الحساب سيتم إعلام مدير الموقع ليقوم بتفعيل حسابك. سوف يتم إعلامك عند المصادقة على الحساب.\\nحالما يتم تفعيل الحساب يمكنك تسجيل الدخول إلى موقع %s باستخدام اسم المستخدم و كلمة المرور التي ادخلتها عند التسجيل:\\n\\nاسم المستخدم: %s', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(344, 'COM_USERS_EMAIL_USERNAME_REMINDER_BODY', 'مرحباً،\\n\\nلقد تم إنشاء طلب التذكير باسم المستخدم %s الخاص بحسابك.\\n\\nاسم المستخدم الخاص بك هو %s.\\n\\nلتسجيل الدخول إلى حسابك, قم بالضغط على الرابط أدناه.\\n\\n%s \\n\\nوشكراً.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(345, 'COM_USERS_EMAIL_USERNAME_REMINDER_SUBJECT', 'اسم المستخدم %s الخاص بك', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(346, 'COM_USERS_ERROR_SECRET_CODE_WITHOUT_TFA', 'لقد قمت بادخال كود التحقق لكن خاصية التحقق بخطوتين غير مفعلة لحسابك. إذا كنت تريد أن تستخدم هذه الخاصية فيرجى تجير الحساب الخاص بك في صفحتك الخاصة و تفعيل خيار التحقق بخطوتين.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
(347, 'COM_USERS_FIELD_PASSWORD_RESET_DESC', 'يرجى إدخال عنوان البريد الإلكتروني الخاص بحسابك لدينا.<br /> سوف يتم إرسال كود التحقق إلى هذا العنوان. حالما تستلم كود التحقق, سيكون بإمكانك تعيين كلمة مرور جديدة', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
