(349, 'COM_USERS_FIELD_REMIND_EMAIL_DESC', 'يرجى إدخال عنوان البريد الإلكتروني المرتبط مع حساب المستخدم الخاص بك.<br /> سيتم إرسال اسم المستخدم إلى عنوان البريد الإلكتروني الموجود في ملف المستخدم.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.com_users.ini'),
