(632, 'JFIELD_ALIAS_DESC', 'سيتم استخدام الاسم المستعار من أجل صداقة الروابط لمحركات البحث (SEF URL). إذا تم ترك الاسم المستعار فارغاً فسيقوم نظام جوملا! بملئه بشكل افتراضي بالاسم، وهذا يتوقف على إعدادات (SEO) في (الإعدادات العامة> الموقع). <br/> استخدام اليونيكود (Unicode) سوف يقوم بكتابة أسماء مستعارة بترميز UTF8. يمكنك أيضا إدخال أية أحرف utf8 بشكل يدوي. سيتم استبدال المسافات والأحرف الغير مسموح بها بالشرطات (-) (hyphens). <br/> عند استخدام الطريقة الافتراضية وهي كتابة لغة باستخدام أحرف لغة أخرى (transliteration)، سيتم كتابة الاسم المستعار باسلوب ضعيف وبإستخدام الشرطات (-) بدلاً من المسافات. يمكنك كتابة الاسم المستعار بشكل يدوي، استخدم الأحرف الصغيرة والشرطات (-). غير مسموح باستخدام المسافات والشرطات السفلية(_). ستتم كتابة التاريخ والوقت كاسم مستعار افتراضي إذا تم كتابة العنوان بأحرف غير لاتينية', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.ini'),
