(1418, 'JLIB_RULES_SETTING_NOTES', '1. إذا قمت بتغيير الإعدادات، فسوق يطبق التغيير على هذا التطبيق. لاحظ ذلك:<br/><em>موروث</em> يعني أنه سيتم استخدام التراخيص من الإعدادات العامة ومن مجموعة المستخدمين الأم.<br /><em>ممنوع</em> يعني أنه غير مرتبط بالإعدادات الموجودة في الإعدادات العامة أو إعدادات مجموعة المستخدمين الأم، وأن إجراء التغيير على مجموعة المستخدمين التي يجري تعديلها غير ممكن في هذا التطبيق.<br /> <em>مسموح</em> يعني أن إجراء التغيير على مجموعة المستخدمين التي يجري تعديلها ممكناً في هذا التطبيق (لكن إن كان التغيير متعارضاً مع الإعدادات العامة أو مجموعة المستخدمين الأم فلن يكون له أي تأثير; التعارض سوف يكون مشار إليه بواسطة <em>غير مسموح (مقفل)</em> تحت الإعدادات المطبقة).<br />2. إن قمت بتحديد إعدادات جديدة، اضغط <em>حفظ</em> لتحديث الإعدادات المطبقة.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.lib_joomla.ini'),
(1419, 'JLIB_RULES_SETTING_NOTES_ITEM', '1. إذا قمت بتغيير الإعدادات، فسوف يطبق التغيير على هذا المقال. لاحظ ذلك:<br/><em>موروث</em> يعني أنه سيتم استخدام التراخيص من الإعدادات العامة ومن مجموعة المستخدمين الأم والمجموعة.<br /> <em>ممنوع</em> يعني أنه غير مرتبط بالإعدادات الموجودة في الإعدادات العامة أو إعدادات مجموعة المستخدمين الأم أو إعدادات المجموعة، وأن إجراء التغيير على مجموعة المستخدمين التي يجري تعديلها غير ممكن في هذا المقال.<br /> <em>مسموح</em> يعني أن إجراء التغيير على مجموعة المستخدمين التي يجري تعديلها ممكناً في هذا المقال (لكن إن كان التغيير متعارضاً مع الإعدادات العامة أو مجموعة المستخدمين الأم أو المجموعة الأم فلن يكون له أي تأثير; التعارض سوف يكون مشار إليه بواسطة <em>غير مسموح (مقفل)</em> تحت الإعدادات المطبقة).<br />2. إن قمت بتحديد إعدادات جديدة، اضغط <em>حفظ</em> لتحديث الإعدادات المطبقة.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.lib_joomla.ini'),
(1420, 'JLIB_RULES_SETTINGS_DESC', 'إدارة إعدادات تراخيص مجموعات المستخدمين. شاهد الملاحظات في الأسفل.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.lib_joomla.ini'),
