(1761, 'MOD_LANGUAGES_FIELD_FULL_NAME_DESC', 'اذا اخترت ''نعم'' و صوة الأعلام ''لا'', يتم عرض الاسم الكامل للغة. اذا اخترت ''لا'', يتم استخدام الإختصارات الدالة على اللغة للروابط الصديقة sef. مثال: EN للغة الانجليزية, AR للغة العربية.', 'D:\\xampp\\htdocs\\joomla34\\sj_vicmagz\\language\\ar-AA\\ar-AA.mod_languages.ini'),
